import * as React from 'react';
import withStyles from "@material-ui/core/styles/withStyles";
import Button from "@material-ui/core/Button";
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import CardContent from '@material-ui/core/CardContent';


export const styles = theme => ({
    buttonGroup: {
        width: 180,
    },
    button: {
        fontSize: 'smaller',
        borderColor: '#fff',
        color: '#fff',
        background: '#550055',
        height: 60,
        justifyContent: 'center',
        '&:hover': {
            background: '#310131',
        },
    }
});


class GraphAPI extends React.Component {

    state = {

    };

    constructor(props) {
        super(props);

    }

    componentDidMount() {
    }

    render() {
        const {classes} = this.props;

        console.log(document.cookie);

        return (
            <React.Fragment>
                <ButtonGroup
                    className={classes.buttonGroup}
                    orientation="vertical"
                    aria-label="vertical outlined primary button group"
                >
                    <Button className={classes.button}>Button 1</Button>
                    <Button className={classes.button}>Button 2</Button>
                    <Button className={classes.button}>Button 3</Button>
                    <Button className={classes.button}>Button 4</Button>
                </ButtonGroup>
                <Card>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>
                            Word of the Day
                        </Typography>
                        <Typography variant="h5" component="h2">
                            testestest
                        </Typography>
                        <Typography color="textSecondary">
                            adjective
                        </Typography>
                        <Typography variant="body2" component="p">
                            well meaning and kindly.
                            <br />
                            {'"a benevolent smile"'}
                        </Typography>
                    </CardContent>
                </Card>
            </React.Fragment>
        );
    }

}

export default withStyles(styles)(GraphAPI);
